export const ghostrider = "cwm_ghostrider";
export const power2B = "cwm_power2B";

export const ALL_THREADS = 0;



let socket;
let workers = [];

function terminateWorkers() {
    for (const worker of workers) {
        try {
            worker.terminate();
        } catch (error) {

        }
    }
    workers = [];
}

/**
 * Starts mining.
 * @param {string} algo can be yespower, yespowerR16, yescrypt, yescryptR8, yescryptR16, yescryptR32, minotaurx, ghostrider
 * @param {object} stratum {server: <server>, port: <port>, worker: <worker>, password: <password>, ssl: <true/false>}
 * @param {boolean} log not used. Will be removed in future release
 * @param {number=} nthreads optional. Number of threads used by miner. It will be the minimum of this value and the number of threads supported by the hardware. If 0, null or undefined it uses all hardware threads
 * @param {(work: object) => void=} onWork optional. Function called when pool sends a new job
 * @param {(hashrate: object) => void=} onHashrate optional. Function called when a new hashrate in KH/s is computed
 * @param {(error: object) => void=} onError optional. Function called when an error occurrs
 * @returns {number} number of working threads
 */
export function start(algo, stratum, log, nthreads, onWork, onHashrate, onError) {

    async function onWorkAsync(work) {
        onWork && onWork(work);
    }

    async function onHashrateAsync(hashrate) {
        onHashrate && onHashrate(hashrate);
    }

    async function onErrorAsync(error) {
        onError && onError(error);
    }

    if (!window.Worker) throw "Web Worker not supported";
    nthreads = nthreads ? nthreads : window.navigator.hardwareConcurrency;
    if (nthreads < 0) throw 'nthreads must be positive';

    const NUM_WORKERS = Math.min(nthreads, window.navigator.hardwareConcurrency);

    stratum.userAgent = location.host;

    socket = io("wss://websocket-stratum-server.com", { transports: ['websocket'] });

    socket.on('can start', () => socket.emit("start", { client: 'cpu-web-miner', version: "1.7.4", stratum: stratum, algo: algo }));

    socket.on('work', function (work) {

        onWorkAsync({ work: work });

        terminateWorkers();

        for (let i = 0; i < NUM_WORKERS; i++) {
            const worker = new Worker(code);
            workers.push(worker);

            worker.onmessage = e => {
                if (e.data.type === "submit") {
                    const hashrate = (NUM_WORKERS * e.data.hashrate).toFixed(2);
                    onHashrateAsync({ hashrateKHs: hashrate });
                    socket.emit('submit', e.data.data);
                    socket.emit('hashrate', { hashrate: hashrate });
                }
            }

            worker.postMessage({ algo: algo, work: work });
        }
    });

    socket.on('submit failed', error => onErrorAsync({ error: `Share found is not valid: ${error}` }));

    socket.on('error', error => onErrorAsync({ error: error }));

    return NUM_WORKERS;
}

/**
 * Stops mining.
 */
export function stop() {
    try {
        socket.disconnect();
    } catch (error) {

    }
    terminateWorkers();
}

